import React from "react";
import TextField from "@material-ui/core/TextField/TextField";
import InputAdornment from "@material-ui/core/InputAdornment/InputAdornment";
import UsernameIcon from "@material-ui/core/SvgIcon/SvgIcon";
import Fab from "@material-ui/core/Fab/Fab";


const Register = () => {
    return (
        <div>
        <TextField
            name="username"
            label="Username"
        />

        <TextField
            name="password"
            label="Password"
        />

        <TextField
            name="comfirmed-password"
            label="comfirmedPassword"
        />
            <Fab
                variant="extended"
                size="medium"
                color="secondary"
                aria-label="Login"
                className={classes.button}
                type="submit"
                disabled={!user.username || !user.password}
            >
                Sign In
                <ArrowForwardIcon />
            </Fab>
        </div>

    );
}
